College Rules - Tailgating college sluts take it in the ass

Feb 4, 2011

Tailgates are always fun, especially when your team wins! This week we received a nutty submission from what appears to be a postgame celebration tailgate party. These crazy students were enjoying themselves a lil too much, which isn't a bad thing -- especially when there are titties involved. Things got nice and heavy once the party went inside the RV and the clothes came off!
